div.note:
Likaledes beviljades ledighet från riksdagsgöromålen: åt Herr
Hans Larsson i Flästa, i anledning af sjukdomsfall inom hans familj,
under 8 dagar från och med denna dag;

N:o 7, i anledning af Kongl. Maj:ts proposition angående afsöndring
af jord från kaptensbostället Long Storegården N:o 3 vid Westgöta
regemente;

N:o 9, i anledning af Kongl. Maj:ts proposition, angående upphörande
af afgäld för boställsjord, som användes för arméns vapenöfningar;
samt
